import React from "react";
import images from "../images";
import ImageCard from "./ImageCard";
import "../styles/Home.css";

const Home = () => {
  return (
    <div className="home-grid">
      {images.map((img) => (
        <ImageCard key={img.id} image={img} />
      ))}
    </div>
  );
};

export default Home;
